import Navbar from './Components/Navbar';
import Login from './Components/Login';
import './App.css';
import { BrowserRouter,Switch, Route } from 'react-router-dom';
import Register from './Components/Register';

function App() {
  return (
    <>
    <Navbar/>
    <BrowserRouter>
      <Switch>
        <Route exact path = "/">
          <Login/>  
        </Route>
        <Route exact path = "/register">
          <Register/>
        </Route>
      </Switch>
    </BrowserRouter>
    </>   
    );
}

export default App;
